import React from 'react';
import './Login.css';
import { useHistory } from "react-router-dom";

function Login() {
    const login = (event) => {
        event.preventDefault();
    }

    const register = (event) => {
        event.preventDefault();
    }
    return (
        <div className='login'>
            <div className='login_form'>
                <p className='login_form_title'>Welcome back!</p>
                <p className='login_form_description'>We're so excited to see you again!</p>
                <p className='login_form_emailText'>EMAIL</p>
                <input className='login_form_emailInput'></input>
                <p className='login_form_passwordText'>PASSWORD</p>
                <input className='login_form_passwordInput'></input>
                <button className='login_form_submit'>Login</button>
                <button className='login_form_register'>Register</button>
            </div>
        </div>
    )
}

export default Login
